import React from 'react';
import './App.css';



class App extends React.Component {
  state(){

  }

  render(){
    return (
      <div className="App">
        <header>
          <p>
            To DO List
          </p>
        </header>
        <div>
          <input id="input" type="text" onchange="add()" placeholder="What needs to be done?" />
          <div></div>
        </div>
      </div>
    );
  }
}

export default App;
